      <GoogleMapReact
        bootstrapURLKeys={{key: 'AIzaSyAQEqRFhrBSWtWERhlQ2tTUhb2eiHuhDbg'}}
        center={15, 16}
        defaultZoom={12}
        yesIWantToUseGoogleMapApiInternals
      />
    );
  }
}

export default MapContainer;
